-- ----------------------------
-- Table structure for sea_home_notification
-- ----------------------------
DROP TABLE IF EXISTS `sea_home_notification`;
CREATE TABLE `sea_home_notification` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '通知ID',
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '通知用户ID',
  `type` varchar(20) NOT NULL DEFAULT '' COMMENT '通知类型：friend-好友请求',
  `new` tinyint(1) NOT NULL DEFAULT '0' COMMENT '通知是否为新:"1"为新通知,"0"为通知已读',
  `authorid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '作者用户ID',
  `author` varchar(15) NOT NULL DEFAULT '' COMMENT '作者用户名',
  `remark` text NOT NULL COMMENT '通知内容',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '通知时间',
  `from_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '来源对象id',
  `from_idtype` varchar(20) NOT NULL DEFAULT '' COMMENT '来源对象类型',
  `from_num` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '来源量',
  `category` tinyint(1) NOT NULL DEFAULT '0' COMMENT ' 提醒分类 1-我的帖子，2-好友互动，3-系统消息，0-应用消息',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`,`new`),
  KEY `category` (`uid`,`category`,`create_time`),
  KEY `by_type` (`uid`,`type`,`create_time`),
  KEY `from_id` (`from_id`,`from_idtype`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

