-- ----------------------------
-- Table structure for sea_object_exchange
-- ----------------------------
DROP TABLE IF EXISTS `sea_object_exchange`;
CREATE TABLE `sea_object_exchange` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `initiator_id` int(11) NOT NULL DEFAULT '0' COMMENT '发起人ID',
  `initiator_name` varchar(32) NOT NULL DEFAULT '' COMMENT '发起人用户名',
  `receive_id` int(11) NOT NULL DEFAULT '0' COMMENT '接受人ID',
  `receive_name` varchar(32) NOT NULL DEFAULT '' COMMENT '接收人用户名',
  `initiator_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '发起人状态，0-未同意，1-已同意',
  `receive_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '接受人状态，0-未同意，1-已同意',
  `order_sn` char(18) NOT NULL DEFAULT '' COMMENT '交换订单号',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '标题',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '交换状态，-1-已删除，0-待交换，1交换成功，2-撤销',
  `expire_time` int(11) NOT NULL DEFAULT '0' COMMENT '交换过期时间',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
