  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员ID',
  `plan_id` int(11) NOT NULL DEFAULT '0' COMMENT '销售方案ID',
  `seed_id` int(11) NOT NULL DEFAULT '0' COMMENT '物品（种子）ID',
  `seed_name` varchar(200) NOT NULL DEFAULT '' COMMENT '物品名称',
  `weight` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '重量',
  `is_initiator` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否发起人，0-不是，1-是',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '状态，-1-已删除，0-待确认，1-已确认',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='物物交换详情表';

