  `title` varchar(50) DEFAULT NULL COMMENT '视频标题',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单视频表';

