  `density` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '单株占地面积',
  `output_min` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '最小产量(千克/平米)',
  `output_max` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '最大产量(千克/平米)',
