CREATE TABLE `sea_sensitive_vocabulary` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '敏感词汇唯一ID',
  `vocabulary` varchar(255) NOT NULL COMMENT '默认词汇（词汇内容）',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '敏感词汇状态  0禁用  1开启',
  `add_time` int(20) NOT NULL COMMENT '添加时间',
  `uid` int(11) NOT NULL,
  PRIMARY KEY (`id`)
