-- ----------------------------
-- Table structure for sea_sms_code
-- ----------------------------
DROP TABLE IF EXISTS `sea_sms_code`;
CREATE TABLE `sea_sms_code` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `mobile` char(16) NOT NULL COMMENT '手机号码',
  `code` char(20) NOT NULL COMMENT '给手机发送的短信验证码',
  `time` int(13) NOT NULL COMMENT '发送时间',
  `type` char(20) NOT NULL COMMENT '模板别名',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '验证码状态 1正常  -1失效',
  `key` varchar(255) DEFAULT NULL COMMENT '验证码发送后进行下一步验证时的钥匙',
  `key_status` tinyint(2) NOT NULL DEFAULT '1' COMMENT 'key值是否验证过  1未验证，-1已验证',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=262 DEFAULT CHARSET=utf8 COMMENT='手机验证码发送记录';

-- ----------------------------
-- Records of sea_sms_code
-- ----------------------------

-- ----------------------------
-- Table structure for sea_sms_config
-- ----------------------------
DROP TABLE IF EXISTS `sea_sms_config`;
CREATE TABLE `sea_sms_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` char(15) NOT NULL DEFAULT '' COMMENT '短信平台编码',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '短信平台名称',
  `config` text NOT NULL COMMENT '配置内容（序列化存储）',
  `is_default` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否默认发送接口，0-否，1-是',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='短信配置接口';

-- ----------------------------
-- Records of sea_sms_config
-- ----------------------------

-- ----------------------------
-- Table structure for sea_sms_log
-- ----------------------------
DROP TABLE IF EXISTS `sea_sms_log`;
CREATE TABLE `sea_sms_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `uid` int(11) DEFAULT NULL COMMENT '用户ID',
  `mobile` varchar(15) NOT NULL DEFAULT '' COMMENT '手机号码',
  `content` varchar(360) NOT NULL COMMENT '发送内容',
  `add_time` int(11) NOT NULL COMMENT '发送时间',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '发送结果：0-失败，1-成功',
  `type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '区分前后台  1后台  0 前台会员',
  `platform` varchar(200) NOT NULL COMMENT '短信发送平台',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=398 DEFAULT CHARSET=utf8 COMMENT='短息发送日志表';

-- ----------------------------
-- Records of sea_sms_log
-- ----------------------------

-- ----------------------------
-- Table structure for sea_sms_tpl
-- ----------------------------
DROP TABLE IF EXISTS `sea_sms_tpl`;
CREATE TABLE `sea_sms_tpl` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '模板ID',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '模板名称',
  `alias` varchar(50) NOT NULL COMMENT '模板别名（唯一）',
  `content` varchar(320) NOT NULL DEFAULT '' COMMENT '模板内容',
  `param` varchar(500) NOT NULL COMMENT '模板参数 1 name,2',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) NOT NULL COMMENT '模板修改时间',
  PRIMARY KEY (`id`),
  KEY `alias` (`alias`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='短信模板表';

