DROP TABLE IF EXISTS `sea_transport`;
CREATE TABLE `sea_transport` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '运费模板ID',
  `title` varchar(30) NOT NULL DEFAULT '' COMMENT '运费模板名称',
  `sea_id` int(11) NOT NULL DEFAULT '0' COMMENT '农场ID',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后更新时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='运费模板';

-- ----------------------------
-- Records of sea_transport
