-- ----------------------------
-- Table structure for sea_transport_extend
-- ----------------------------
DROP TABLE IF EXISTS `sea_transport_extend`;
CREATE TABLE `sea_transport_extend` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '运费模板扩展ID',
  `area_id` text NOT NULL COMMENT '市级地区ID组成的串，以，隔开，两端也有，',
  `top_area_id` text NOT NULL COMMENT '省级地区ID组成的串，以，隔开，两端也有，',
  `area_name` text NOT NULL COMMENT '地区name组成的串，以，隔开',
  `first_weight` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '首件重量',
  `first_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '首件价格',
  `next_weight` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '续件重量',
  `next_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '续件价格',
  `is_default` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否默认：0-否，1-是',
  `transport_id` int(11) NOT NULL DEFAULT '0' COMMENT '运费模板ID',
  `transport_title` varchar(60) NOT NULL DEFAULT '' COMMENT '运费模板标题',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='运费模板扩展表';

-- ----------------------------
-- Records of sea_transport_extend
-- ----------------------------

-- ----------------------------
-- Table structure for sea_user
-- ----------------------------
DROP TABLE IF EXISTS `sea_user`;
CREATE TABLE `sea_user` (
  `uid` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `user_name` char(32) NOT NULL DEFAULT '' COMMENT '用户名',
  `nick_name` varchar(50) NOT NULL DEFAULT '' COMMENT '昵称',
  `sea_name` varchar(50) NOT NULL DEFAULT '' COMMENT '农场名称',
  `real_name` varchar(30) NOT NULL DEFAULT '' COMMENT '真实姓名',
  `id_card` char(18) NOT NULL DEFAULT '' COMMENT '身份证号码',
  `user_pass` char(32) NOT NULL DEFAULT '' COMMENT '用户登录密码',
  `user_encrypt` char(6) NOT NULL DEFAULT '' COMMENT '登录密码加密盐',
  `pay_pass` char(32) NOT NULL DEFAULT '' COMMENT '支付密码',
  `pay_encrypt` char(6) NOT NULL DEFAULT '' COMMENT '支付密码加密盐',
  `user_email` varchar(70) NOT NULL DEFAULT '' COMMENT '用户邮箱',
  `user_avatar` varchar(255) NOT NULL DEFAULT '' COMMENT '用户头像',
  `user_phone` char(16) NOT NULL DEFAULT '' COMMENT '用户手机号码',
  `user_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '用户类型：1-普通用户，2-普通受邀用户，3-农场主，4-农场主受邀',
  `device_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '机型：0-暂无，1-IOS，2-Android，3-pc',
  `login_token` varchar(300) NOT NULL DEFAULT '' COMMENT '登录token',
  `device_uuid` varchar(36) NOT NULL DEFAULT '' COMMENT '设备标识',
  `device_token` varchar(60) NOT NULL DEFAULT '' COMMENT '推送标识',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态：-1-删除，0-正常，1-锁定，2-冻结',
  `province` varchar(50) NOT NULL DEFAULT '' COMMENT '省',
  `city` varchar(50) NOT NULL DEFAULT '' COMMENT '市',
  `district` varchar(50) DEFAULT '' COMMENT '县',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '详细地址',
  `reg_time` int(11) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `last_login_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后登录时间',
  `login_count` int(11) NOT NULL DEFAULT '0' COMMENT '登录次数',
  `reg_ip` char(20) NOT NULL DEFAULT '' COMMENT '注册IP',
  `last_login_ip` char(20) NOT NULL DEFAULT '' COMMENT '最后登录IP',
  `invite_uid` int(11) NOT NULL DEFAULT '0' COMMENT '邀请人ID',
  `lid` int(11) NOT NULL DEFAULT '1' COMMENT '会员等级ID',
  `is_platform` tinyint(3) NOT NULL DEFAULT '0' COMMENT '0普通用户 1平台用户',
  PRIMARY KEY (`uid`)
) ENGINE=MyISAM AUTO_INCREMENT=39 DEFAULT CHARSET=utf8 COMMENT='会员表';

-- ----------------------------
-- Records of sea_user
-- ----------------------------

-- ----------------------------
-- Table structure for sea_user_address
-- ----------------------------
DROP TABLE IF EXISTS `sea_user_address`;
CREATE TABLE `sea_user_address` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT '0' COMMENT '用户ID',
  `consignee` varchar(50) DEFAULT '' COMMENT '收货人姓名',
  `province_id` int(11) DEFAULT NULL,
  `phone` int(11) DEFAULT '0' COMMENT '收货人手机号码',
  `city_id` int(11) DEFAULT '0' COMMENT '城市Id',
  `area_info` varchar(255) DEFAULT '' COMMENT '用户具体收货地址（省份、城市、街道号码）',
  `address` varchar(255) DEFAULT '' COMMENT '街道号码（具体地址）',
  `status` tinyint(1) DEFAULT '0' COMMENT '状态：-1删除 0：正常',
  `is_default` tinyint(1) DEFAULT '0' COMMENT '是否为默认收货地址 0：否 1：是',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='用户默认收货地址';

-- ----------------------------
-- Records of sea_user_address
-- ----------------------------

-- ----------------------------
-- Table structure for sea_user_level
-- ----------------------------
DROP TABLE IF EXISTS `sea_user_level`;
CREATE TABLE `sea_user_level` (
  `level_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '会员等级ID',
  `level_name` varchar(200) NOT NULL DEFAULT '' COMMENT '会员等级名称',
  `cash_highter` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '该等级最高消费（充值）上限',
  `cash_lower` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '该等级最低消费（充值）下限',
  `exchange_policy` text NOT NULL COMMENT '兑换策略',
  `icon` varchar(255) NOT NULL DEFAULT '' COMMENT '等级图表',
  `listorder` mediumint(8) NOT NULL DEFAULT '0' COMMENT '排序',
  `uid` int(11) NOT NULL COMMENT '创建者ID（后台管理员）',
  `add_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '修改时间',
  `operator` int(11) NOT NULL COMMENT '修改人',
  PRIMARY KEY (`level_id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='用户等级表';

-- ----------------------------
-- Records of sea_user_level
-- ----------------------------

-- ----------------------------
-- Table structure for sea_verify
-- ----------------------------
DROP TABLE IF EXISTS `sea_verify`;
CREATE TABLE `sea_verify` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '索引ID',
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `code` varchar(32) NOT NULL DEFAULT '' COMMENT '验证码',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '验证类型：待定',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `type` (`type`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='用户验证表（短息， 邮箱等）';

