INSERT INTO `sea_admin_operate_log` VALUES ('2317', '1', '1452846408', '127.0.0.1', '1', '提示语：新增成功<br/>模块：Admin,控制器：Seed,方法：add<br/>请求方式：AJAX', 'http://farm.com/admin.php?s=/Seed/add.html', 'http://farm.com/admin.php?s=/Seed/add.html', 'seed_name:山药,seed_img:Array,seed_price:10,density:5,output_min:200,output_max:30,period_seeding:70,period_nursery:10,period_grow:30,period_maturity:20,period_reap:10,seed_descript:山药又称薯蓣、土薯、山薯蓣、怀山药、淮山、白山药，是《中华本草》收载的草药，药用来源为薯蓣科植物山药干燥根茎。山药具有滋养强壮，助消化，敛虚汗，止泻之功效，主治脾虚腹泻、肺虚咳嗽、糖尿病消渴、小便短频、遗精、妇女带下及消化不良的慢性肠炎。山药最适宜与灵芝搭配服用，具有防治糖尿病的作用，山药在食品业和加工业上大有发展前途。,seed_usage:选择疏松肥沃的、排水良好的沙质壤土和无有积水黏土，而且疏松紧密品质好，但产量低，背风向阳的地栽培为宜，然后冬翻66厘米左右，施足基肥5000千克，深翻50～60厘米，春季浅耕15～20厘米。播前浇透底水，整地作畦，多数采用垄作，垄宽120厘米，两垄间的沟作排水、灌溉。,');
INSERT INTO `sea_admin_operate_log` VALUES ('2318', '1', '1452846784', '127.0.0.1', '0', '提示语：模板别名已存在！<br/>模块：Admin,控制器：Sms,方法：tpladd<br/>请求方式：AJAX', 'http://farm.com/admin.php?s=/Sms/tpladd.html', 'http://farm.com/admin.php?s=/Sms/tpladd.html', 'name:测试,alias:test,param:[code],[baidu],content:请在[baidu]，输入[code],');
