INSERT INTO `sea_admin_operate_log` VALUES ('2320', '1', '1452846945', '127.0.0.1', '1', '提示语：更新成功<br/>模块：Admin,控制器：Seed,方法：edit<br/>请求方式：AJAX', 'http://farm.com/admin.php?s=/Seed/edit/id/23.html', 'http://farm.com/admin.php?s=/Seed/edit.html', 'seed_id:23,seed_name:山药,seed_img:Array,seed_price:10.00,density:5.00,output_min:30,output_max:70,period_seeding:5,period_nursery:10,period_grow:30,period_maturity:20,period_reap:10,seed_descript:山药又称薯蓣、土薯、山薯蓣、怀山药、淮山、白山药，是《中华本草》收载的草药，药用来源为薯蓣科植物山药干燥根茎。山药具有滋养强壮，助消化，敛虚汗，止泻之功效，主治脾虚腹泻、肺虚咳嗽、糖尿病消渴、小便短频、遗精、妇女带下及消化不良的慢性肠炎。山药最适宜与灵芝搭配服用，具有防治糖尿病的作用，山药在食品业和加工业上大有发展前途。,seed_usage:选择疏松肥沃的、排水良好的沙质壤土和无有积水黏土，而且疏松紧密品质好，但产量低，背风向阳的地栽培为宜，然后冬翻66厘米左右，施足基肥5000千克，深翻50～60厘米，春季浅耕15～20厘米。播前浇透底水，整地作畦，多数采用垄作，垄宽120厘米，两垄间的沟作排水、灌溉。,');
INSERT INTO `sea_admin_operate_log` VALUES ('2321', '1', '1452847073', '127.0.0.1', '1', '提示语：新增成功<br/>模块：Admin,控制器：Seed,方法：add<br/>请求方式：AJAX', 'http://farm.com/admin.php?s=/Seed/add.html', 'http://farm.com/admin.php?s=/Seed/add.html', 'seed_name:秋葵,seed_img:Array,seed_price:2.36,density:5,output_min:50,output_max:100,period_seeding:2,period_nursery:5,period_grow:10,period_maturity:20,period_reap:3,seed_descript:秋葵（学名：Abelmoschus esculentus (Linn.) Moench）：中文学名咖啡黄奎，又名黄秋葵。原产于埃塞俄比亚南部，虽也多见于中国南方，但并非原产自中国。其可食用部分是果荚，分绿色和红色两种，口感脆嫩多汁，滑润不腻，香味独特，种子可榨油。并非以讹传讹的说是20世纪初才传入中国，早间南宋就有《秋葵图》可见其早就是我国物种。,seed_usage:秋葵适宜在土层深厚，土层疏松肥沃的地块上种植。整地同时施足基肥。一般每亩施土杂粪2000公斤，饼肥100公斤。育苗一般于3月底至4月中旬在阳畦或日光温室里播种。苗床土按菜园土、腐熟有机肥和细砂6:3:1的比例配制，以10厘米见方的密度点播。因黄秋葵种壳较坚硬，所以播前应先浸种24小时，后放在25～30℃下催芽，4～5天发芽，苗龄30～40天，即幼苗3～4叶时定植。直播一般于4月上旬至5月上中旬播种，株行距15×40厘米,每穴播2～3粒种子。地膜覆盖栽培可早播4～6天。当苗长出两叶时进行间苗，每穴只留一株壮苗，4～5叶时定苗。,');
