INSERT INTO `sea_admin_operate_log` VALUES ('2407', '1', '1453088580', '127.0.0.1', '1', '提示语：修改种子信息成功<br/>模块：Admin,控制器：Seed,方法：edit<br/>请求方式：AJAX', 'http://farm.com/admin.php?s=/Seed/edit/id/24.html', 'http://farm.com/admin.php?s=/Seed/edit.html', 'seed_id:24,seed_name:秋葵,seed_sn:01160115425987301,seed_img:Array,seed_price:2.36,density:5.00,output_min:50.00,output_max:100.00,period_seeding:2,period_nursery:5,period_grow:10,period_maturity:20,period_reap:3,seed_usage:<p>秋葵适宜在土层深厚，土层疏松肥沃的地块上种植。整地同时施足基肥。一般每亩施土杂粪2000公斤，饼肥100公斤。育苗一般于3月底至4月中旬在阳畦或日光温室里播种。苗床土按菜园土、腐熟有机肥和细砂6:3:1的比例配制，以10厘米见方的密度点播。因黄秋葵种壳较坚硬，所以播前应先浸种24小时，后放在25～30℃下催芽，4～5天发芽，苗龄30～40天，即幼苗3～4叶时定植。直播一般于4月上旬至5月上中旬播种，株行距15×40厘米,每穴播2～3粒种子。地膜覆盖栽培可早播4～6天。当苗长出两叶时进行间苗，每穴只留一株壮苗，4～5叶时定苗。</p><p style=\"text-align: center;\"><img src=\"/uploads/ueditor/image/20160118/1453088554842131.jpg\" title=\"1453088554842131.jpg\" alt=\"54fbb2fb43166d22a46567c9402309f79052d259.jpg\"/></p>,seed_descript:<p>秋葵（学名：Abelmoschus esculentus (Linn.) Moench）：中文学名咖啡黄奎，又名黄秋葵。原产于埃塞俄比亚南部，虽也多见于中国南方，但并非原产自中国。其可食用部分是果荚，分绿色和红色两种，口感脆嫩多汁，滑润不腻，香味独特，种子可榨油。并非以讹传讹的说是20世纪初才传入中国，早间南宋就有《秋葵图》可见其早就是我国物种。</p>,');
