le=\"margin: 0px; padding: 0px 5px 0px 0px; display: block; height: 24px; float: left; font-stretch: normal; font-size: 20px; line-height: normal; font-family: Tahoma, sans-serif; color: rgb(187, 187, 187);\">3.</span>再放入<a href=\"http://www.haodou.com/recipe/all/245\" target=\"_blank\" style=\"color: rgb(106, 151, 0);\">南瓜</a>、<a href=\"http://www.haodou.com/recipe/all/144\" target=\"_blank\" style=\"color: rgb(106, 151, 0);\">山药</a>，小火<a href=\"http://www.haodou.com/recipe/all/481\" target=\"_blank\" style=\"color: rgb(106, 151, 0);\">煮</a>15分钟。</p></li><li><p><img src=\"http://recipe1.hoto.cn/pic/step/m/03/ef/3534595.jpg\" width=\"190\" alt=\"南瓜山药粥的做法步骤4\" style=\"margin: 0px; padding: 0px; border: none; vertical-align: middle;\"/></p><p class=\"sstep\" style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 20px; padding: 0px; word-wrap: break-word; word-break: break-all; width: 360px; float: left; font-size: 14px; line-height: 24px;\"><span style=\"margin: 0px; padding: 0px 5px 0px 0px; display: block; height: 24px; float: left; font-stretch: normal; font-size: 20px; line-height: normal; font-family: Tahoma, sans-serif; color: rgb(187, 187, 187);\">4.</span>最后下入洗净的枸杞，放一勺冰糖，拌匀，<a href=\"http://www.haodou.com/recipe/all/481\" target=\"_blank\" style=\"color: rgb(106, 151, 0);\">煮</a>一分钟，即可出锅。</p></li></ul><ul class=\"prompt list-paddingleft-2\" style=\"margin: 0px -20px; padding: 0px 20px 10px; width: 570px; clear: both; overflow: hidden; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(233, 233, 233); color: rgb(51, 51, 51); font-family: Tahoma, Arial, Helvetica, 宋体, &#39;Arial Narrow&#39;, Geneva, sans-serif; font-size: 12px; line-height: 19.2px; white-space: normal;\"><li style=\"\"><p>小贴士</p></li><li style=\"\"><p><span data=\"1、米要开水下锅，这样不容易粘锅。\r\n2、加入南瓜和山药后要注意搅拌。\" id=\"stips\">1、米要开水下锅，这样不容易粘锅。<br/>2、加入南瓜和山药后要注意搅拌。</span></p></li></ul><p><br/></p>,');
