er: 0px; display: block; margin: 0px auto; width: 149px; height: 220px; float: right;\"/></a></p><p>不发生侧枝；叶掌状5裂，互生，叶身有茸毛或刚毛，叶柄细长，中空；花大而黄，着生于叶腋。</p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"1_2\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub52032_1_2\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"叶\"></a></p><h3 class=\"para-title level-3\" style=\"margin: 20px 0px 12px; padding: 0px; font-size: 18px; color: rgb(51, 51, 51); font-family: &#39;Microsoft YaHei&#39;, SimHei, Verdana; line-height: 19px; clear: both; font-weight: 500; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"title-text\">叶</span></h3><p>叶互生，叶之上下两面被有粗毛，掌状3～5裂或浅裂，在植株下半段的叶片较为圆阔大形，自上半段起叶片逐渐变为细狭小形。另有圆叶种，叶型圆阔如<a target=\"_blank\" href=\"http://baike.baidu.com/view/1841969.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">蓖麻叶</a>。叶柄长，中空，叶背有白色透明小颗粒。</p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"1_3\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub52032_1_3\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"花\"></a></p><h3 class=\"para-title level-3\" style=\"margin: 20px 0px 12px; padding: 0px; font-size: 18px; color: rgb(51, 51, 51); font-family: &#39;Microsoft YaHei&#39;, SimHei, Verdana; line-height: 19px; clear: both; font-weight: 500; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"title-text\">花</span></h3><p>花腋生，花腋在主株上第4～10多节开始着生，以后通常每节着生一花，花为完全花，花瓣黄色，通常是5片，基部暗红色，花期仅有数小时，当天午后即萎谢，花谢后3～4天左右便可采收嫩果。 呈掌形分裂，有5～7个裂片，裂片披针形，先端渐尖；边缘有钝锯齿，叶柄细长，中空。花直径4～8cm，花瓣由白到黄，花瓣根部有红色或紫色斑点，色艳丽，具观赏价值。</p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"1_4\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub52032_1_4\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"果实\"></a></p><h3 class=\"para-title level-3\" style=\"margin: 20px 0px 12px; padding: 0px; font-size: 18px; color: rgb(51, 51, 51); font-family: &#39;Microsoft YaHei&#39;, SimHei, Verdana; line-height: 19px; clear: both; font-weight: 500; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"title-text\">果实</span></h3><p><a class=\"image-link\" nslog-type=\"9317\" href=\"http://baike.baidu.com/pic/%E7%A7%8B%E8%91%B5/947422/0/d01373f082025aaf613d6fddfcedab64034f1a9c?fr=lemma&ct=single\" target=\"_blank\" title=\"秋葵籽\" style=\"color: rgb(19, 110, 194); text-decoration: none; display: block; width: 165px; height: 220px;\"><img class=\"\" src=\"/uploads/ueditor/image/20160119/1453183205965418.jpg\" alt=\"秋葵籽\" style=\"border: 0px; display: block; margin: 0px auto; width: 165px; height: 220px;\"/></a><span class=\"description\" style=\"display: block; color: rgb(85, 85, 85); font-size: 12px; text-indent: 0px; font-family: 宋体; word-wrap: break-word; word-break: break-all; line-height: 15px; padding: 8px 7px; min-height: 12px; border-top-width: 1px; border-top-style: solid; border-top-color: rgb(224, 224, 224);\">秋葵籽</span></p><p>果实为<a target=\"_blank\" href=\"http://baike.baidu.com/view/321336.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">蒴果</a>，长10余公分，先端细尖，略有弯曲，细长似羊角或辣椒，果皮薄革质，先端尖细，果色从淡绿至深绿色，亦有紫红色者；果形可分长果形或短果形，5角至多角，也有呈圆形者。果实含有特殊黏滑物质，更具有特殊香气或风味。果实老熟后转呈黑色，木质化纵裂，心室间有薄膜间隔，每一心室（子室）有种子10粒多，种子球形，比豌豆稍小，灰褐色。果长10～25cm、横径1.9～3.6cm。果面覆有细密白色绒毛，果成熟后木质化不可食；种子球形，绿豆大小，外皮粗，被细毛。内含多颗种子。种子球形，灰黑色，千粒重约55克。</p><p><br/></p><p><br/></p>,');
