INSERT INTO `sea_admin_operate_log` VALUES ('2589', '1', '1453260218', '127.0.0.1', '1', '提示语：商品编辑成功，即将返回商品列表！<br/>模块：Admin,控制器：Shop,方法：edit<br/>请求方式：AJAX', 'http://farm.com/admin.php?s=/Shop/edit/id/1.html', 'http://farm.com/admin.php?s=/Shop/edit.html', 'goods_name:野秋葵,id:1,goods_status:1,plan_id:19,goods_weight:500.00,goods_price:20.00,goods_stock:1000.00,transport_id:1,goods_description:秋葵（学名：Abelmoschus esculentus (Linn.) Moench）：中文学名咖啡黄奎，又名黄秋葵。原产于埃塞俄比亚南部，虽也多见于中国南方，但并非原产自中国。其可食用部分是果荚，分绿色和红色两种，口感脆嫩多汁，滑润不腻，香味独特，种子可榨油。并非以讹传讹的说是20世纪初才传入中国，早间南宋就有《秋葵图》可见其早就是我国物种。,goods_image:Array,goods_image_more:Array,goods_body:<p><a target=\"_blank\" href=\"http://baike.baidu.com/view/92223.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">黄秋葵</a>是<a target=\"_blank\" href=\"http://baike.baidu.com/view/1208841.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">一年生</a>草本植物。根系发达，吸收力强，茎直立分枝，直根性，根深达1m以上。</p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"1_1\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub52032_1_1\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"茎\"></a></p><h3 class=\"para-title level-3\" style=\"margin: 20px 0px 12px; padding: 0px; font-size: 18px; color: rgb(51, 51, 51); font-family: &#39;Microsoft YaHei&#39;, SimHei, Verdana; line-height: 19px; clear: both; font-weight: 500; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"title-text\">茎</span></h3><p>主茎直立，高1～2.5m，粗5cm，赤绿色，圆柱形，基部节间较短，茎部木质化，自基部节位生侧枝数条，自着花节位起</p><p><a class=\"image-link\" nslog-type=\"9317\" href=\"http://baike.baidu.com/pic/%E7%A7%8B%E8%91%B5/947422/0/bd3eb13533fa828bc512efbefb1f4134970a5abd?fr=lemma&ct=single\" target=\"_blank\" title=\"\" style=\"color: rgb(19, 110, 194); text-decoration: none; display: block; width: 149px; height: 220px;\"><img class=\"\" src=\"/uploads/ueditor/image/20160119/1453183205720050.jpg\" alt=\"\" style=\"border: 0px; display: block; margin: 0px auto; width: 149px; height: 220px; float: right;\"/></a></p><p>不发生侧枝；叶掌状5裂，互生，叶身有茸毛或刚毛，叶柄细长，中空；花大而黄，着生于叶腋。</p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"1_2\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub52032_1_2\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"叶\"></a></p><h3 class=\"para-title level-3\" style=\"margin: 20px 0px 12px; padding: 0px; font-size: 18px; color: rgb(51, 51, 51); font-family: &#39;Microsoft YaHei&#39;, SimHei, Verdana; line-height: 19px; clear: both; font-weight: 500; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"title-text\">叶</span></h3><p>叶互生，叶之上下两面被有粗毛，掌状3～5裂或浅裂，在植株下半段的叶片较为圆阔大形，自上半段起叶片逐渐变为细狭小形。另有圆叶种，叶型圆阔如<a target=\"_blank\" href=\"http://baike.baidu.com/view/1841969.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">蓖麻叶</a>。叶柄长，中空，叶背有白色透明小颗粒。</p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"1_3\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub52032_1_3\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"花\"></a></p><h3 class=\"para-title level-3\" style=\"margin: 20px 0px 12px; padding: 0px; font-size: 18px; color: rgb(51, 51, 51); font-family: &#39;Microsoft YaHei&#39;, SimHei, Verdana; line-height: 19px; clear: both; font-weight: 500; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"title-text\">花</span></h3><p>花腋生，花腋在主株上第4～10多节开始着生，以后通常每节着生一花，花为完全花，花瓣黄色，通常是5片，基部暗红色，花期仅有数小时，当天午后即萎谢，花谢后3～4天左右便可采收嫩果。 呈掌形分裂，有5～7个裂片，裂片披针形，先端渐尖；边缘有钝锯齿，叶柄细长，中空。花直径4～8cm，花瓣由白到黄，花瓣根部有红色或紫色斑点，色艳丽，具观赏价值。</p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"1_4\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub52032_1_4\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"果实\"></a></p><h3 class=\"para-title level-3\" style=\"margin: 20px 0px 12px; padding: 0px; font-size: 18px; color: rgb(51, 51, 51); font-family: &#39;Microsoft YaHei&#39;, SimHei, Verdana; line-height: 19px; clear: both; font-weight: 500; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"title-text\">果实</span></h3><p><a class=\"image-link\" nslog-type=\"9317\" href=\"http://baike.baidu.com/pic/%E7%A7%8B%E8%91%B5/947422/0/d01373f082025aaf613d6fddfcedab64034f1a9c?fr=lemma&ct=single\" target=\"_blank\" title=\"秋葵籽\" style=\"color: rgb(19, 110, 194); text-decoration: none; display: block; width: 165px; height: 220px;\"><img class=\"\" src=\"/uploads/ueditor/image/20160119/1453183205965418.jpg\" alt=\"秋葵籽\" style=\"border: 0px; display: block; margin: 0px auto; width: 165px; height: 220px;\"/></a><span class=\"description\" style=\"display: block; color: rgb(85, 85, 85); font-size: 12px; text-indent: 0px; font-family: 宋体; word-wrap: break-word; word-break: break-all; line-height: 15px; padding: 8px 7px; min-height: 12px; border-top-width: 1px; border-top-style: solid; border-top-color: rgb(224, 224, 224);\">秋葵籽</span></p><p>果实为<a target=\"_blank\" href=\"http://baike.baidu.com/view/321336.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">蒴果</a>，长10余公分，先端细尖，略有弯曲，细长似羊角或辣椒，果皮薄革质，先端尖细，果色从淡绿至深绿色，亦有紫红色者；果形可分长果形或短果形，5角至多角，也有呈圆形者。果实含有特殊黏滑物质，更具有特殊香气或风味。果实老熟后转呈黑色，木质化纵裂，心室间有薄膜间隔，每一心室（子室）有种子10粒多，种子球形，比豌豆稍小，灰褐色。果长10～25cm、横径1.9～3.6cm。果面覆有细密白色绒毛，果成熟后木质化不可食；种子球形，绿豆大小，外皮粗，被细毛。内含多颗种子。种子球形，灰黑色，千粒重约55克。</p><p><br/></p><p><br/></p>,');
INSERT INTO `sea_admin_operate_log` VALUES ('2590', '1', '1453260347', '127.0.0.1', '1', '提示语：商品添加成功，即将返回商品列表！<br/>模块：Admin,控制器：Shop,方法：add<br/>请求方式：AJAX', 'http://farm.com/admin.php?s=/Shop/add.html', 'http://farm.com/admin.php?s=/Shop/add.html', 'goods_name:油麦菜,goods_status:0,plan_id:18,goods_weight:100000,goods_price:800,goods_stock:1000000,transport_id:1,goods_description:新鲜蔬菜，活血，养气，提神！,goods_image:/uploads/Picture/goods/2016-01-20/f010cefe0cd6397c749d48f45339f501.png,goods_body:<h2 class=\"fl\" style=\"margin: 0px; padding: 4px 0px 0px; float: left; font-weight: normal; font-stretch: normal; font-size: 12px; line-height: 1.2; font-family: &#39; 微软雅黑&#39;, 宋体, Arial; color: rgb(106, 151, 0);\">油麦菜的功效与作用</h2><p class=\"mgt10\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; word-wrap: break-word; word-break: break-all; color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\">降低胆固醇<br/>、治疗神经衰弱<br/>、清燥润肺、化痰止咳。</p><p><a style=\"color: rgb(102, 102, 102); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\" name=\"go_pick\"></a><span style=\"color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; background-color: rgb(255, 255, 255);\"></span></p><h2 class=\"mgt20\" style=\"margin: 20px 0px 0px; padding: 0px; font-weight: normal; font-stretch: normal; font-size: 12px; line-height: 1.2; font-family: &#39; 微软雅黑&#39;, 宋体, Arial; color: rgb(106, 151, 0); white-space: normal; background-color: rgb(255, 255, 255);\">如何挑选油麦菜</h2><p class=\"mgt10\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; word-wrap: break-word; word-break: break-all; color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\">选购时以肉质呈青色为佳。</p><p><a style=\"color: rgb(102, 102, 102); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\" name=\"go_skill\"></a><span style=\"color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; background-color: rgb(255, 255, 255);\"></span></p><h2 class=\"mgt20\" style=\"margin: 20px 0px 0px; padding: 0px; font-weight: normal; font-stretch: normal; font-size: 12px; line-height: 1.2; font-family: &#39; 微软雅黑&#39;, 宋体, Arial; color: rgb(106, 151, 0); white-space: normal; background-color: rgb(255, 255, 255);\">油麦菜的制作技巧</h2><p class=\"mgt10\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; word-wrap: break-word; word-break: break-all; color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\">1.油麦菜炒的时间不能过长，断生即可，否则会影响成菜的口感和鲜艳的色泽。<br/><br/>2.海鲜酱油、生抽不能放得太多，否则成菜会失去清淡的口味。<br/><br/>3.因可能有农药化肥的残留，生吃前一定要洗净。<br/><br/>4.对乙烯极为敏感，储藏时应远离苹果、梨、香蕉，以免诱发赤褐斑点。<br/><br/>5.食用方法以生食为主，可以凉拌，也可蘸各种调料。熟食可炒食，可涮食，味道独特。</p><p><a style=\"color: rgb(102, 102, 102); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\" name=\"go_storage\"></a><span style=\"color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; background-color: rgb(255, 255, 255);\"></span></p><h2 class=\"mgt20\" style=\"margin: 20px 0px 0px; padding: 0px; font-weight: normal; font-stretch: normal; font-size: 12px; line-height: 1.2; font-family: &#39; 微软雅黑&#39;, 宋体, Arial; color: rgb(106, 151, 0); white-space: normal; background-color: rgb(255, 255, 255);\">油麦菜的保存方法</h2><p class=\"mgt10\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; word-wrap: break-word; word-break: break-all; color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/>3天，油麦菜的贮藏适宜温度为0℃，适宜相对湿度95%以上。要轻收、轻放，避免机械损伤。</p><p><a style=\"color: rgb(102, 102