INSERT INTO `sea_admin_operate_log` VALUES ('2614', '1', '1453345353', '127.0.0.1', '1', '提示语：商品编辑成功，即将返回商品列表！<br/>模块：Admin,控制器：Shop,方法：edit<br/>请求方式：AJAX', 'http://farm.com/admin.php?s=/Shop/edit/id/4.html', 'http://farm.com/admin.php?s=/Shop/edit.html', 'goods_name:油麦菜,id:4,goods_status:1,plan_id:18,goods_weight:100000.00,goods_price:800.00,goods_stock:1000000.00,transport_id:1,goods_description:新鲜蔬菜，活血，养气，提神！,goods_image:Array,goods_image_more:Array,goods_body:<h2 class=\"fl\" style=\"margin: 0px; padding: 4px 0px 0px; float: left; font-weight: normal; font-stretch: normal; font-size: 12px; line-height: 1.2; font-family: &#39; 微软雅黑&#39;, 宋体, Arial; color: rgb(106, 151, 0);\">油麦菜的功效与作用</h2><p class=\"mgt10\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; word-wrap: break-word; word-break: break-all; color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\">降低胆固醇<br/>、治疗神经衰弱<br/>、清燥润肺、化痰止咳。</p><p><a style=\"color: rgb(102, 102, 102); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\" name=\"go_pick\"></a><span style=\"color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; background-color: rgb(255, 255, 255);\"></span></p><h2 class=\"mgt20\" style=\"margin: 20px 0px 0px; padding: 0px; font-weight: normal; font-stretch: normal; font-size: 12px; line-height: 1.2; font-family: &#39; 微软雅黑&#39;, 宋体, Arial; color: rgb(106, 151, 0); white-space: normal; background-color: rgb(255, 255, 255);\">如何挑选油麦菜</h2><p class=\"mgt10\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; word-wrap: break-word; word-break: break-all; color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\">选购时以肉质呈青色为佳。</p><p><a style=\"color: rgb(102, 102, 102); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\" name=\"go_skill\"></a><span style=\"color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; background-color: rgb(255, 255, 255);\"></span></p><h2 class=\"mgt20\" style=\"margin: 20px 0px 0px; padding: 0px; font-weight: normal; font-stretch: normal; font-size: 12px; line-height: 1.2; font-family: &#39; 微软雅黑&#39;, 宋体, Arial; color: rgb(106, 151, 0); white-space: normal; background-color: rgb(255, 255, 255);\">油麦菜的制作技巧</h2><p class=\"mgt10\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; word-wrap: break-word; word-break: break-all; color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\">1.油麦菜炒的时间不能过长，断生即可，否则会影响成菜的口感和鲜艳的色泽。<br/><br/>2.海鲜酱油、生抽不能放得太多，否则成菜会失去清淡的口味。<br/><br/>3.因可能有农药化肥的残留，生吃前一定要洗净。<br/><br/>4.对乙烯极为敏感，储藏时应远离苹果、梨、香蕉，以免诱发赤褐斑点。<br/><br/>5.食用方法以生食为主，可以凉拌，也可蘸各种调料。熟食可炒食，可涮食，味道独特。</p><p><a style=\"color: rgb(102, 102, 102); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\" name=\"go_storage\"></a><span style=\"color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; background-color: rgb(255, 255, 255);\"></span></p><h2 class=\"mgt20\" style=\"margin: 20px 0px 0px; padding: 0px; font-weight: normal; font-stretch: normal; font-size: 12px; line-height: 1.2; font-family: &#39; 微软雅黑&#39;, 宋体, Arial; color: rgb(106, 151, 0); white-space: normal; background-color: rgb(255, 255, 255);\">油麦菜的保存方法</h2><p class=\"mgt10\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; word-wrap: break-word; word-break: break-all; color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/>3天，油麦菜的贮藏适宜温度为0℃，适宜相对湿度95%以上。要轻收、轻放，避免机械损伤。</p><p><a style=\"color: rgb(102, 102, 102); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\" name=\"go_tizhi\"></a><span style=\"color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; background-color: rgb(255, 255, 255);\"></span></p><h2 class=\"mgt20\" style=\"margin: 20px 0px 0px; padding: 0px; font-weight: normal; font-stretch: normal; font-size: 12px; line-height: 1.2; font-family: &#39; 微软雅黑&#39;, 宋体, Arial; color: rgb(106, 151, 0); white-space: normal; background-color: rgb(255, 255, 255);\">油麦菜的适合体质</h2><p class=\"mgt10\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; word-wrap: break-word; word-break: break-all; color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\">平和质体质；<br/>一般人群均可食用。</p><p><a style=\"color: rgb(102, 102, 102); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\" name=\"go_qa\"></a><span style=\"color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; background-color: rgb(255, 255, 255);\"></span></p><h2 class=\"mgt20\" style=\"margin: 20px 0px 0px; padding: 0px; font-weight: normal; font-stretch: normal; font-size: 12px; line-height: 1.2; font-family: &#39; 微软雅黑&#39;, 宋体, Arial; color: rgb(106, 151, 0); white-space: normal; background-color: rgb(255, 255, 255);\">油麦菜问题库</h2><p class=\"mgt10\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; word-wrap: break-word; word-break: break-all; color: rgb(153, 153, 153); font-family: SimSun; font-size: 12px; line-height: 19.2px; white-space: normal; background-color: rgb(255, 255, 255);\">·<a href=\"http://www.haodou.com/recipe/food/qa-1951\" title=\"油麦菜的营养价值\" target=\"_blank\" style=\"text-decoration: none; color: rgb(102, 102, 102);\">油麦菜的营养价值</a></p><p><br/></p>,');
