INSERT INTO `sea_seed` VALUES ('22', '01160104195926301', '卷心菜', '[\"\\/uploads\\/Picture\\/Seed\\/6c0691714e6441e4bbc957117a6ac51f.jpg\",\"\\/uploads\\/Picture\\/Seed\\/55f89f63877891044934ed9dd2c39001.png\",\"\\/uploads\\/Picture\\/Seed\\/3aeac5fe00803650d2fff6bc3bd2dadf.jpg\"]', '<p><img src=\"http://img.baidu.com/hi/jx2/j_0003.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0005.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0026.gif\"/></p>', null, '12.00', '0.00', '0.00', '0.00', '0', '0', '0', '0', '0', '1', '1451896063', '1453886626');
INSERT INTO `sea_seed` VALUES ('23', '01160115645920801', '山药', '[\"\\/uploads\\/Picture\\/Seed\\/d7dc2250d1eae64538234602438cc5c0.jpg\",\"\\/uploads\\/Picture\\/Seed\\/8fc7067853ee1b5040ebd1d4a1a052c7.jpg\"]', '山药又称薯蓣、土薯、山薯蓣、怀山药、淮山、白山药，是《中华本草》收载的草药，药用来源为薯蓣科植物山药干燥根茎。山药具有滋养强壮，助消化，敛虚汗，止泻之功效，主治脾虚腹泻、肺虚咳嗽、糖尿病消渴、小便短频、遗精、妇女带下及消化不良的慢性肠炎。山药最适宜与灵芝搭配服用，具有防治糖尿病的作用，山药在食品业和加工业上大有发展前途。', '选择疏松肥沃的、排水良好的沙质壤土和无有积水黏土，而且疏松紧密品质好，但产量低，背风向阳的地栽培为宜，然后冬翻66厘米左右，施足基肥5000千克，深翻50～60厘米，春季浅耕15～20厘米。播前浇透底水，整地作畦，多数采用垄作，垄宽120厘米，两垄间的沟作排水、灌溉。', '10.00', '5.00', '30.00', '70.00', '5', '10', '30', '20', '10', '1', '1452846408', '1452846945');
INSERT INTO `sea_seed` VALUES ('24', '01160115425987301', '秋葵', '[\"\\/uploads\\/Picture\\/Seed\\/fe058f29f6d775ac55c916638838cd64.jpg\",\"\\/uploads\\/Picture\\/Seed\\/53dac4cdc15474d5ff3635102471f0cf.jpg\"]', '<p>秋葵（学名：Abelmoschus esculentus (Linn.) Moench）：中文学名咖啡黄奎，又名黄秋葵。原产于埃塞俄比亚南部，虽也多见于中国南方，但并非原产自中国。其可食用部分是果荚，分绿色和红色两种，口感脆嫩多汁，滑润不腻，香味独特，种子可榨油。并非以讹传讹的说是20世纪初才传入中国，早间南宋就有《秋葵图》可见其早就是我国物种。</p>', '<p>秋葵适宜在土层深厚，土层疏松肥沃的地块上种植。整地同时施足基肥。一般每亩施土杂粪2000公斤，饼肥100公斤。育苗一般于3月底至4月中旬在阳畦或日光温室里播种。苗床土按菜园土、腐熟有机肥和细砂6:3:1的比例配制，以10厘米见方的密度点播。因黄秋葵种壳较坚硬，所以播前应先浸种24小时，后放在25～30℃下催芽，4～5天发芽，苗龄30～40天，即幼苗3～4叶时定植。直播一般于4月上旬至5月上中旬播种，株行距15×40厘米,每穴播2～3粒种子。地膜覆盖栽培可早播4～6天。当苗长出两叶时进行间苗，每穴只留一株壮苗，4～5叶时定苗。</p><p style=\"text-align: center;\"><img src=\"/uploads/ueditor/image/20160118/1453088554842131.jpg\" title=\"1453088554842131.jpg\" alt=\"54fbb2fb43166d22a46567c9402309f79052d259.jpg\"/></p>', '2.36', '5.00', '50.00', '100.00', '2', '5', '10', '20', '3', '1', '1452847073', '1453088580');
